  input: '"TEXT","F3XA","C00167320","Amendment to 12 Day Pre-General Report (10/1/06
    - 10/18/06)    Q1.  The mistype of the incorrect beginning cash balance of this
    report now correctly reflects the ending balance of our Amended October monthly
    report.  Q2./Q3. Following the amended September report this amended October report
    numbers have been corrected.  Q4. We have added details to disbursements that
    listed purpose as Consulting fee on Schedule B.   Q5. The voter id calls on Schedule
    B were generic in nature and did not promote, support, attack, or oppose any candidate
    nor did they contain expressed advocacy.  Q6. Due to a computer error schedule
    F inadvertently failed to disclose the designated committee- this has been corrected
    and Schedule F now lists the designating committee as the Democratic Congressional
    Committee.  Q7. With the removal of various disbursements to H6, the year to date
    for the administrative category has been corrected.  Q8. The expenditure made
    for Room rental fee on Schedule H was for the rental of a room to hold a meeting
    which was neither for a fundraiser nor for any candidate.  We have clarified this
    under purpose in the disbursement.  Q9. The committee has amended the report to
    remove these disbursements to H6.  Please note that the committee has also submitted
    a Schedule H6 for the nonfederal portion of the disbursements.  Q10. Schedule
    H4 disclosed a payment of $6,868.80 for voter file building consulting- the recipient
    is not an employee of the committee.   Q11. Transfers of funds from party committee
    and party organizations are appropriately pulling to Line 12."'
